import s from "./footer.module.css";
import logo from "../../assets/images/svg/logo-bookmark2.svg";
export const Footer = () => {
  return (
    <>
      <div className={s.bg}>
        <a className={s.logo}>
          <img src={logo} alt="logo"></img>
        </a>
      </div>
    </>
  );
};
